const ImagemProduto = (props) => {
    return ( <div className="container-imagens">
        <img className="img-principal" src="./imagens/ga021.png" alt="Imagem Produto"/>

    <div className="imagens-aux">
    <img src="./imagens/ga021.png" alt="Imagem Produto"/>


    </div>



    </div> );
}
 
export default ImagemProduto;
